import css from "styled-jsx/css";

const style = css`
  .repos-wrapper {
    width: 100%;
    height: 100vh;
    overflow: scroll;
    padding: 0px 16px;
  }
  .repos-header {
    padding: 16px 0;
    font-size: 14px;
    font-weight: 600;
    border-bottom: 1px solid #e1e4e8;
  }
  .repos-count {
    display: inline-block;
    padding: 2px 5px;
    margin-left: 6px;
    font-size: 12px;
    font-weight: 600;
    line-height: 1;
    color: #586069;
    background-color: rgba(27, 31, 35, 0.08);
    border-radius: 20px;
  }
  .repos {
    list-style-type: none;
    padding: 0;
  }
  .repo-item {
    margin: 10px 0;
  }
  .repo-link {
    text-decoration: none;
    color: #0366d6;
  }
  .repo-link:hover {
    text-decoration: underline;
  }
`;

export const Repositories = ({ repos }) => {
  if (!repos || repos.length === 0) {
    return <div>No repositories found</div>;
  }
  return (
    <div className="repos-wrapper">
      <div className="repos-header">
        Repositories
        <span className="repos-count">{repos.length}</span>
      </div>
      <ul className="repos">
        {repos.map((repo) => (
          <li key={repo.id} className="repo-item">
            <a
              href={repo.html_url}
              target="_blank"
              rel="noopener noreferrer"
              className="repo-link"
            >
              {repo.name}
            </a>
          </li>
        ))}
      </ul>
      <style jsx>{style}</style>
    </div>
  );
};
